import Cookies from "js-cookie";
import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getCalendarsById } from "../../../action/CalendarAction";


const AllCalendarsPage = () => {
    const Categories = useSelector(state => state.Calendar)
    const auth = useSelector(state=>state.Auth)
    const tokenn = auth.token

    const dispatch = useDispatch()
    if (tokenn === '') {
        return (<>Please login</>)
    }
    useEffect = ( () => {
        dispatch(getCalendarsById(2))
    }, [dispatch])
    return (
        <div>

        </div>
    )
}

export default AllCalendarsPage
